  const handleClickForConcerns = () => {
    // Handle click action for concerns button
    console.log('Clicked for concerns');
    // Add navigation or any other action as needed
  };

  return (
    <div>
      <Header navigateTo={navigateTo} />
      <div className="quiz-page" style={{ backgroundImage: `url(${process.env.PUBLIC_URL}/quiz.png)` }}>
        {/* Your quiz content goes here */}
        <div className="concerns-button-container">
          <button className="concerns-button" onClick={handleClickForConcerns}>
            CLICK FOR CONCERNS
          </button>
        </div>
      </div>
    </div>
  );
};

export default Quiz;
